⚠️ Несмотря на острый дефицит зерна и угрозу продовольственного кризиса, украинские вооруженные формирования, пренебрегая благополучием собственного народа, продолжают использовать критически важные объекты переработки и хранения зерновых культур в военных целях:

🔹 в населенном пункте Губаревка Харьковской области на территории элеватора боевики подразделений территориальной обороны разместили бронетехнику и оборудовали огневые позиции артиллерии;

🔹 в Харьковской области на территории Золочевского элеватора подразделения ВСУ разместили артиллерийские орудия западного образца (предположительно, американские гаубицы М777), из которых обстреливают приграничные районы Российской Федерации;

🔹 в поселке Новоэкономическое Донецкой Народной Республики и селе Нововасильевка Сумской области в ангарах зерно- и картофелехранилищ размещены подразделения ВСУ, а на прилегающей территории – тяжелая бронетехника, крупнокалиберная артиллерия и РСЗО;

🔹 в населенном пункте Новодонецкое Донецкой Народной Республики боевики украинских националистических формирований разместили на территории элеватора артиллерию и РСЗО, из которых систематически обстреливают близлежащие населенные пункты.

❗️ Цель подобных действий украинских националистов – спровоцировать ответный огонь, после чего по уже отработанному сценарию с широким медийным освещением в украинских и западных СМИ обвинить Вооруженные Силы России в якобы неизбирательных ударах по объектам гражданской инфраструктуры и создании угрозы продовольственной безопасности Украины.

